Условия чрезвычайного положения, которые будут введены в Киеве:

▪️если передвигаться по городу, нужно всегда иметь документ, удостоверяющий личность;
▪️ дискотекам, ночным клубам, ресторанам и кафе разрешат работать только с 7 утра до 23 вечера;
▪️ на основных въездах в Киев установят контрольно-пропускные пункты;
▪️ особый контроль будет внедрен за пассажирами на железнодорожном вокзале и в аэропорту «Киев»;

Также усиливается охрана объектов критической инфраструктуры и зданий органов власти. К последним ограничат доступ. Патрулировать улицы правоохранителям будет помогать сотрудники Муниципальной варты.

